#include "Solution.h"
#include "gtest\gtest.h"
using std::vector;
using std::pair;
using std::make_pair;

int main(int argc, char* argv[])
{
    ::testing::InitGoogleTest(&argc, argv);
    RUN_ALL_TESTS();

    // pause to show the results
    getchar();
    return 0;
}

TEST(EmptyTest, EmptyTest)
{
    Solution sol;
    auto result = sol.findOrder(0, vector<pair<int, int>>());

    EXPECT_EQ(0, result.size());
}

TEST(FuckyouIdiotTest, FuckyouIdiotTest)
{
    Solution sol;
    auto result1 = sol.findOrder(1, vector<pair<int, int>>());
    EXPECT_EQ(1, result1.size());

    auto result2 = sol.findOrder(2, vector<pair<int, int>>());
    EXPECT_EQ(2, result2.size());

    auto result3 = sol.findOrder(5, vector<pair<int, int>>({ make_pair(1, 0) }));
    EXPECT_EQ(5, result3.size());

    auto result4 = sol.findOrder(4, vector<pair<int, int>>({ make_pair(3, 0), make_pair(0, 1) }));
    EXPECT_EQ(4, result4.size());
}

TEST(LeetcodeExampleTest, LeetcodeExampleTest1)
{
    Solution sol;
    auto result = sol.findOrder(2, vector<pair<int, int>>({ make_pair(1, 0) }));

    EXPECT_EQ(2, result.size());
    EXPECT_EQ(0, result[0]);
    EXPECT_EQ(1, result[1]);
}

TEST(LeetcodeExampleTest, LeetcodeExampleTest2)
{
    Solution sol;
    auto result = sol.findOrder(4, vector<pair<int, int>>({ make_pair(1, 0), make_pair(2, 0), make_pair(3, 1), make_pair(3, 2) }));

    EXPECT_EQ(4, result.size());
    
    vector<int> ans1 = { 0, 1, 2, 3 };
    vector<int> ans2 = { 0, 2, 1, 3 };
    
    for (int i = 0; i < result.size(); ++i)
    {
        EXPECT_TRUE(result[i] == ans1[i] || result[i] == ans2[i]);
    }
}

